        $font.on('change', function (e) {
            var font = $(e.target)
                .val();
            setFont({
                font: font
            });
        });
        $theme.on('change', function (e) {
            var theme = $(e.target)
                .val();
            setTheme({
                theme: theme
            });
        });
        $resetstyle.on('click', resetStyle);
        storage.get('theme', setTheme);
        storage.get('font', setFont);
        $wrapper.css('opacity', 1);
